                        className="text-blue-600 hover:text-blue-700 font-semibold transition-colors"
                      >
                        info@timelycapital.com
                      </a>
                    </div>
                  </div>
                </CardContent>
              </Card>

              {/* Address */}
              <Card className="border-0 shadow-lg hover:shadow-xl transition-shadow duration-300">
